import React, { useState } from 'react';
import "./form.css"

const Form = () => {
  const [users, setUsers] = useState([]);
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [role, setRole] = useState('');
  const [classHandling, setClassHandling] = useState('');
  const [subjects, setSubjects] = useState('');

  const addUser = () => {
    const newUser = {
      name,
      email,
      password,
      role,
      classHandling: classHandling.split(','),
      subjects: subjects.split(','),
    };

    setUsers([...users, newUser]);
    setName('');
    setEmail('');
    setPassword('');
    setRole('');
    setClassHandling('');
    setSubjects('');
  };

  return (
    <div className='adduser'>
      <div className='userform'>
      <form className="add" onSubmit={(e) => e.preventDefault()}>
        <label>Name:</label>
        <input type="text" value={name} onChange={(e) => setName(e.target.value)} />
        <br />
        <label>Email:</label>
        <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} />
        <br />
        <label>Password:</label>
        <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} />
        <br />
        <label>Role:</label>
        <select type="text" value={role} onChange={(e) => setRole(e.target.value)} />
        <option>Select role</option>
        <option>HoD</option>
        <option>Timetable Co-ordinator</option>
        <option>Advisor</option>
        <option></option>

        <br />
        <label>Class Handling (comma-separated):</label>
        <input type="text" value={classHandling} onChange={(e) => setClassHandling(e.target.value)} />
        <br />
        <label>Subjects (comma-separated):</label>
        <input type="text" value={subjects} onChange={(e) => setSubjects(e.target.value)} />
        <br />
        <button className='addbutton' onClick={addUser}>Add User</button>
      </form>
      </div>
      <h2>User List</h2>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Email</th>
            <th>Password</th>
            <th>Role</th>
            <th>Class Handling</th>
            <th>Subjects</th>
          </tr>
        </thead>
        <tbody>
          {users.map((user, index) => (
            <tr key={index}>
              <td>{user.name}</td>
              <td>{user.email}</td>
              <td>{user.password}</td>
              <td>{user.role}</td>
              <td>{user.classHandling.join(', ')}</td>
              <td>{user.subjects.join(', ')}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Form;
